import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import MainTitle from './components/MainTitle/MainTitle.js'; 
import MainSearchBar from './components/MainSearchBar/MainSearchBar.js';
import Boxes from './components/ContentBox/Boxes.js';
import TopicsPage from './components/TopicsPage/TopicsPage'; 
import './App.css'

function App() {
  return (
    <Router>
      <div className="App">
        <MainTitle />
        <MainSearchBar onSearch={searchTerm => console.log(searchTerm)} />
        <Switch>
          <Route exact path="/" component={Boxes} />
          <Route path="/topics/:topicId" component={TopicsPage} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
